import React from 'react';
import FormList from './components/FormList/FormList';

function App() {
  return (
    <div className="App">
      <div className="container">
          <nav className="navbar navbar-light bg-info text-white">
              <h5>Form Manager</h5>
            </nav>
        <FormList></FormList>
      </div>
    </div>
  );
}

export default App;
